// Layout component

import React from 'react';
import Sidebar from './Sidebar';

const LoginLayout = ({ children }) => {
  return (
    <div className="main-container">
      <div className="content w-[110%] textCentre">{children}</div>
    </div>
  );
};

export default LoginLayout;
